import React from "react";
import "./Footer.css";

function Footer() {
  return (
    <div className="footer_container">
      <h1 className="footer_title">Thanks for visiting my website!</h1>
      <h1 className="subtitle">You can check out more stuff here</h1>
    </div>
  );
}

export default Footer;
